import{_ as o,c as s,b as t,h as n,w as l,e as a,a0 as i,r as d,o as m}from"./chunks/framework.RVVD-68g.js";const _=JSON.parse('{"title":"2019年工作总结","description":"时光荏苒，2019年不知不觉已经在我们手中流逝，回首2019年，现在将自己的前端开发工作总结一下","frontmatter":{"date":"2020-01-01T00:00:00.000Z","title":"2019年工作总结","category":"工作总结","tags":["工作总结"],"description":"时光荏苒，2019年不知不觉已经在我们手中流逝，回首2019年，现在将自己的前端开发工作总结一下"},"headers":[],"relativePath":"posts/2020/year-end-summary.md","filePath":"posts/2020/year-end-summary.md"}'),p={name:"posts/2020/year-end-summary.md"},u={id:"年终工作总结",tabindex:"-1"};function c(h,e,f,y,b,g){const r=d("center");return m(),s("div",null,[t("h1",u,[n(r,null,{default:l(()=>e[0]||(e[0]=[a("年终工作总结")])),_:1}),e[1]||(e[1]=a()),e[2]||(e[2]=t("a",{class:"header-anchor",href:"#年终工作总结","aria-label":'Permalink to "<center>年终工作总结</center>"'},"​",-1))]),e[3]||(e[3]=i('<p>时光荏苒，2019年不知不觉已经在我们手中流逝，也许是因为忙碌，也许是因为充实，所有觉得时间过得很快。来到我们的这个积极向上的清宁智能已经将近1年了。在工作中，经历了很多欢快困难的时刻，结识了一批工作上的好同事，生活上的好朋友，领悟了很多新技能，感谢领导给了我展示的空间。在2019年的这段时间里，通过自身的不懈努力，在工作上取得了一定的成果，但也存在了很多不足之处。回首2019年，现在将前端开发工作总结一下：</p><h2 id="一、完成的工作" tabindex="-1">一、 完成的工作 <a class="header-anchor" href="#一、完成的工作" aria-label="Permalink to &quot;一、	完成的工作&quot;">​</a></h2><ul><li><ol><li>完成LIMS系统的功能 本年度的工作在公司领导的正确指导和全部门所有人员众志成城，精诚合作，不懈努力，基本保证了各项任务在规定时间内，高标准，严要求的完成。这和公司领导的正确指导，大力支持，全部门员工的不懈努力密不可分。从框架选型，我们就精益求精，将多个框架的优势相互融合，搭建起了我们的LIMS系统，无论是前端还是后端框架，都是很优秀的，前端我们选用新的框架vue+elementUI的组合，在跟上技术更新的同时提高了开发效率。主要实现的功能模块： <strong>PC端主要实现的功能如下：</strong> 基础管理：项目包管理，报表模板管理，标液配置管理，用户字典，分配方案，化学式参数管理等7大模块 系统管理：系统消息，通知公告，原始记录管理，用户管理，菜单管理，角色管理，系统字典，大屏轮播，题库管理等9大模块 资源管理：标物管理，耗材管理，剧毒管理，易制毒管理，易制爆管理，检定记录，核查记录，维修记录等8大模块 财务管理：合同管理，项目收款，费用支出等3个模块 任务管理：样品接收，任务分配，结果录入，结果复核，结果审核等5个模块 完成以上模块功能以及更新迭代，bug修改等任务，对代码进行组件化，模块化的考虑提高开发效率，写的多了也会触碰到自己的知识盲区，也会学习新知识，不断提升自己，作为程序员需要终身学习才能让自己不落伍。在LIMS项目开发中自己也二次封装了一些组件，学到了新知识，自己的技能也得到了进一步的提升。</li></ol></li></ul><p><strong>移动端主要实现如下：</strong> 从零开始搭建项目，完成项目的构建布局，框架选型。用的是vue+vantUI搭建的，最初实现的是4个模块：现场采样，样品接收，结果录入，结果审核。后来逐渐丰富功能，将首页的菜单进行了重写，实现了环评流程，环评表单的动态渲染，环评表单校验等功能，完善了一些自定义组件来辅助动态表单渲染。</p><h2 id="二、对未来的展望" tabindex="-1">二、对未来的展望 <a class="header-anchor" href="#二、对未来的展望" aria-label="Permalink to &quot;二、对未来的展望&quot;">​</a></h2><p>回顾过去，成绩是喜人的，但成绩属于过去，未来的任务会更加艰巨。在看成绩的同时，我也要看到自己的不足，不断的提升自己。不管个人能力有多强，面对工作就俩字-态度。同事之间，朋友之间每个人对待问题都有自己的不同看法，不管他的看法合理与否，考虑的角度是否正确，都要好好聆听。静下心来或许会发现他的看问题的某些角度你没考虑过，所以我们要静心、聆听。 在新的一年中，我希望个人能力上积累更多的技能，壮大自己，提升自己，一个开发人员技术上的提高是必须的，但这还不够，还得加强自己的在某方面的权威，这就要求自己有足够的深度，内涵，知识，技能等。 相信在新的一年中，会取得更大的成绩，为公司发光发热，同时也祝愿公司取得更加辉煌的成就。</p>',6))])}const v=o(p,[["render",c]]);export{_ as __pageData,v as default};
